import React from 'react';
import MyNavbar from './MyNavbar';
import MyCards from './MyCards';
import MyTable from './MyCards';
import { Container } from 'react-bootstrap';

function MyApp() {
  return (
    <div>
      <MyNavbar />
      <Container>
        <MyCards />
        <Container></Container>
      </Container>
    </div>
  );
}

export default MyApp;
